            <br></br>Browse our categories for more specific items, 
            <br></br>add to cart and keep browsing.
            <br></br>At any time you can visit the cart to modify your shopping items and proceed to the checkout.<br></br>
            >Now visit the products section from the product menu in the top.</p><br></br><br></br>

        {/* <img src="/assets/home.png" className="card-img"></img> */}
    </div>
  )
}
